-- Estructura para la vista `nomatch_view`
--
DROP TABLE IF EXISTS `nomatch_view`;

CREATE ALGORITHM=UNDEFINED DEFINER=`enlacecanaco`@`localhost` SQL SECURITY DEFINER VIEW `nomatch_view`  AS SELECT `nomatch`.`nomatch_id` AS `nomatch_id`, `nomatch`.`keyword` AS `keyword`, `nomatch`.`date_nomatch` AS `date_nomatch`, `nomatch`.`usuario_id` AS `usuario_id`, `nomatch`.`status` AS `status`, `nomatch`.`veces_buscado` AS `veces_buscado`, `nomatch`.`keyword` AS `keyw`, (select (to_days(now()) - to_days(`nomatch`.`date_nomatch`)) from `nomatch` where (`nomatch`.`keyword` = `keyw`)) AS `pasan_dias` FROM `nomatch` WHERE (`nomatch`.`status` = '1') ORDER BY `nomatch`.`date_nomatch` DESC ;

