INSERT INTO `notificaciones` (`noti_id`, `notificacion`, `titulo`, `subtitulo`, `info_general`, `llamado_accion`, `users_in`, `callback_users`, `periodicidad`, `img_header`, `img_body`, `img_footer`, `tipo`) VALUES
(1, 'Preregistro', '¡Bienvenid@ %NOMBRE% a la Cámara Nacional de Comercio, Servicios y Turismo del Estado de Querétaro!', 'Por este medio, nos es grato informarle que como Socio de Canaco hemos activado un acceso completamente gratuito a nuestra plataforma tecnológica Enlace Canaco, que tiene como propósito acercar oportunidades de negocio a nuestr@s soci@s, de tal forma que otras empresas comerciales, industriales y de gobierno puedan encontrar empresas como la suya para cubrir sus órdenes de compra y requerimientos de proveedores.\n\nLa dirección del sitio es: https://enlacecanaco.org/login\n\nAdjunto enviamos el manual de Usuario para que pueda ingresar, completar la información de su empresa, datos de contacto del área de ventas así como de compras, productos, servicios y soluciones que su empresa ofrece.\n\nCualquier duda estamos para servirle. Le recordamos que somos la Cámara de los negocios queretanos. \n\nFelicidades por su nuevo perfil en nuestra plataforma. \n\nAriadna Ramírez Guadarrama\nResponsable Plataforma tecnológica Enlace Canaco.\n', 'Complete su perfil y comience a recibir oportunidades de negocios de manera gratuita y sumémonos a la #reactivacióneconómica en nuestro Estado.', 'Si desea mayor información sobre nuestros servicios, soluciones, herramientas y propuesta de valor,<a href=\"https://wa.me/524422198567\" target=\"_blank\"> escríbanos aquí</a> y un afiliador le atenderá personalmente.', 'Admin', 'Actualmente tenemos $regsitro$ preregistros.', 'Quincenal', 'https://enlacecanaco.org/static/images/notifications/header_preregistro.gif', NULL, NULL, 1),
(2, 'Registro 70%', '¡Felicidades! %NOMBRE% tu perfil ha sido completado y podrás comenzar a recibir oportunidades de transacciones comerciales o requerimientos de compra, de grandes empresas, gobierno del Estado, gobiernos municipales o empresas medianas o pequeñas como tú, que desean establecer relaciones comerciales con proveedores serios y confiables.', '¿Sabías que puedes obtener diferentes insignias, valoraciones y medallas conforme solventes mis requerimientos? Revisa como en este vídeo.', 'Publica tu primer requerimiento en nuestra plataforma y encuentra proveedores confiables calidad CANACO.', 'Afíliate hoy mismo a la cámara y obtén tu insignia de negocio afiliado CANACO PREMIUM, da <a href=\"https://www.camaradecomercioqro.mx/membresias/\" target=\"_blank\">click aquí</a>', 'Admin', 'Actualmente tenemos $regsitro$ registros', 'Quincenal', NULL, NULL, NULL, 1),
(3, 'Registro CANACO', 'Hola %NOMBRE% hemos recibido tu comprobante de pago de afiliación, en breve nos comunicaremos contigo para brindarte tu número de afiliación así como tu registro.', '¿Ya conoces todos los beneficios que has activado para tu negocio empresa? <a href=\"https://www.camaradecomercioqro.mx/por-que-es-importante-afiliarse/\" target=\"_blank\">Revísalos aquí</a>\n\n', 'Tu afiliación cuenta con múltiples beneficios sin costo como el trámite de tu licencia municipal o gestión de VoBo de protección civil, contáctanos para mayor información o llámanos, con gusto te atenderemos.', 'Desarrolla las competencias de tu equipo de trabajo con nuestro amplio portafolio de cursos de capacitación que impartimos, revisa nuestra calendarización <a href=\"https://www.camaradecomercioqro.mx/cursos-y-capacitaciones/\" target=\"_blank\">aquí</a>:', 'Admin y superadmin', 'Esta semana se confirmaron $afiliados$ afiliaciones', 'Semanal', NULL, NULL, NULL, 1),
(5, 'Generación de valoración', '¡Gracias por tu aportación!', 'La comunidad emprendedora en nuestro Estado es más fuerte gracias a empresas como la tuya ¿Cuentas con tu afiliación vigente? Afíliate a CANACO Querétaro, la cámara de los negocios queretanos.', 'Actualiza los productos, soluciones y servicios que ofreces y amplia tus posibilidades de cierres de negocio, con los proveedores y afiliados CANACO.', 'Si deseas información personalizada sobre nuestros planes de afiliación o premium, <a href=\"https://www.camaradecomercioqro.mx/membresias/\" target=\"_blank\">escríbenos aquí</a> y un afiliador te atenderá personalmente.', '', '', '', NULL, NULL, NULL, 1),
(6, 'Obtención medalla', 'Felicidades haz obtenido la medalla % que significa %', 'Revisa cuantas medallas te hacen falta para obtener nuestra máxima condecoración: Medalla Diamante que significa que  todas las medallas y la insignia dorada ¿Ya obtuviste tu insignia dorada?', '¿Cómo te fue en tu última valoración en nuestra plataforma? ?Necesitas apoyo en capacitación o entrenamiento? Conoce los cursos, certificaciones y capacitaciones CANACO Querétaro <a href=\"https://www.camaradecomercioqro.mx/membresias/\" target=\"_blank\">click aqui</a>.', 'Renta de salas de capacitación, salones y oficinas. Revisa disponibilidad con uno de nuestros asesores.', 'Admin', 'Se han asignado % medallas en el mes %', 'Mensual\r', NULL, NULL, NULL, 1),
(7, 'Validación de Insignia', 'Hemos validado % con lo cual en tu perfil aparecera la insignia % que está representada por esta imagen %', 'Obtén todas las insignias disponibles (enlistar nombres, imagotipos y definiciones)', 'Publica algún requerimiento que tengas pendiente en nuestra plataforma ¡seguro algún afiliado CANACO podrá apoyarte!', '¿Conoces a la CONCANACO? Visita su <a href=\"https://enlacecanaco.org/\" target=\"_blank\">sitio web</a>', 'Admin', 'Se han asignado _____ insignias en el mes ______', 'Mensual\r', NULL, NULL, NULL, 1),
(8, 'Valoración completa', 'Con los datos detallados que nos haz compartido, podremos mejorar la comunidad CANACO', 'Síguenos en nuestras redes sociales', 'Conoce los organismos en los cuales tenemos representación ante autoridades municipales, estatales o federales.', 'Afilíate hoy mismo a la cámara y obtén tu insignia CANACO PREMIUM (negocio afiliado), da <a href=\"https://enlacecanaco.org/\" target=\"_blank\">click aquí</a>', 'Admin', 'Se han asignado _____ valoraciones en el mes ______', 'Mensual\r', NULL, NULL, NULL, 1),
(9, 'Publicación de requerimiento', 'Tu requerimiento ha sido publicado con éxito, en breve se contactarán contigo comercios queretanos.', 'Tu requerimiento es: %REQ% ¿Quieres editarlo?', 'Si en más de 2 horas no recibes alguna respuesta, te sugerimos cambiar las palabras clave de tu requerimiento. Recuerda revisar las medallas, valoraciones e insignias de los comercios que oferten sus productos, servicios y soluciones.', 'Antes de contactar a alguno de los comercios registrados, revisa nuestras <a href=\"https://enlacecanaco.org/\" target=\"_blank\">políticas de uso y privacidad</a>', 'Admin', 'Se han publicado ______ requerimientos', 'Mensual\r', NULL, NULL, NULL, 1),
(10, 'Publicación de requerimiento exclusivo afiliados', 'Tu requerimiento no es público y ha sido enviado a nuestra selecta comunidad CANACO, en breve recibirás propuestas y soluciones en firme de tu requerimiento.', '¿Conoces los beneficios exclusivos que ofrece nuestro organismo empresarial a sus agremiados? Chécalos aquí', 'Actualmente contamos con % gremios registrados y generamos % oportunidades de negocio diarias. ', 'Visítanos en: Av. Luis Vega Monrroy 405, Quinta Balaustradas, 76079, Santiago de Querétaro, Qro. Tel: +52 442 537 5301', 'Admin y superadmin', 'Se han publicado % requerimientos exclusivos para afiliados', 'Mensual\r', NULL, NULL, NULL, 1),
(11, 'Respuesta a requerimiento', '¿Haz recibido propuestas o cotizaciones para solventar tu requerimiento? SI NO', 'Si no haz recibido alguna respuesta, cambia las palabras clave de tu <a href=\"https://enlacecanaco.org/app/requirements/mis_requerimientos\" target=\"_blank\">requerimiento</a>. Recuerda revisar las medallas, valoraciones e insignias de los comercios que oferten sus productos, servicios y soluciones.', 'Si ya solventaste tu requerimiento ¿Nos ayudas con esta encuesta?', 'Antes de formalizar con alguno de los comercios registrados, revisa nuestras <a href=\"https://enlacecanaco.org/\" target=\"_blank\">políticas de uso y privacidad</a>', '', '', '', NULL, NULL, NULL, 1),
(12, 'Despublicación de requerimiento solventado.', 'Tu requerimiento dejará de ser público. <a href=\"https://enlacecanaco.org/app/requirements/mis_requerimientos\" target=\"_blank\">Confirmar</a>', '¿Tu requerimiento fue solventado por un comercio registrado en nuestra plataforma? SI NO', '¿Deseas calificar al proveedor?', 'Únete a la comunidad CANACO y descubre los servicios PREMIUM que tenemos para tu empresa. <a href=\"https://www.camaradecomercioqro.mx/por-que-es-importante-afiliarse/\" target=\"_blank\">click aqui</a>', '', '', '', NULL, NULL, NULL, 1),
(13, 'Requerimientos pendientes', 'El requerimiento que publicaste el pasado % aún aparece sin solventar ¿Deseas enviar un recordatorio a los matchs encontrados o republicarlo?', '¿Deseas cambiar su status a solventado? <a href=\"https://enlacecanaco.org/app/requirements/mis_requerimientos\" target=\"_blank\">click aqui</a>', 'Ayúdanos a mejorar y contesta esta encuesta % de la efectividad de nuestra plataforma', 'Contrata uno de nuestros <a href=\"https://www.facebook.com/CanacoQro\" target=\"_blank\">lives</a> y llega a ampliar la audiencia para tu marca o negocio (servicio gratuito para la membresía CONSOLIDADO).', '', '', '', NULL, NULL, NULL, 1),
(14, 'Interés por tu requerimiento', 'Se ha registrado una empresa interesada en tu requerimiento, revisa todas sus credenciales, trayectoria y medallas obtenidas.', 'Recuerda que nuestra plataforma es un medio de enlace entre comerciantes establecidos en la ciudad de Querétaro y área conurbada y los cuales son absolutamente responsables de las ofertas, promociones, productos y servicios oferentes sin ser esto vinculatorio o de responsabilidad mercantil o civil para con nuestro organismo. Revisa términos y condiciones del uso de la plataforma enlace CANACO', 'Si decides contratar alguno de las soluciones, servicios o productos que ofrecen nuestros comercios registrados en la plataforma ENLACE CANACO recuerda dar por solventado tu requerimiento y ayúdanos EVALUAR la atención recibida. Juntos podremos consolidar una red confiable de empresarios formales y responsables.', 'Descubre la amplia variedad de beneficios y soluciones que ofrecemos a los comercios en Querétaro. <a href=\"https://www.camaradecomercioqro.mx/por-que-es-importante-afiliarse/\" target=\"_blank\">Visita nuestro sitio web</a>', '', '', '', NULL, NULL, NULL, 1),
(15, 'Oportunidades de negocio sin contestar', 'Hola %nombre% el pasado $ nuestra plataforma encontró una oportunidad de negocio para tu empresa o industria, postula las soluciones, productos y servicios que puedes ofrecer y haz crecer tu negocio.', 'Las medallas que puedes alcanzar por participar activamente en nuestra plataforma son: % Revisa las insignias, valoraciones y medallas que tu comercio actualmente a obtenido <a href=\"https://enlacecanaco.org/app/myaccount/\" target=\"_blank\">aqui</a>', 'Participa activamente en nuestro organismo empresarial y amplia tu red de contactos en nuestros eventos exclusivos, desayunos empresariales, comisiones representativas, conferencias gratuitas, networkings y todo lo que la Cámara de Comercio, Servicios y Turismo de Querétaro, ofrece <a href=\"https://www.camaradecomercioqro.mx/membresias/\" target=\"_blank\">¡Afiliate hoy mismo!</a>', 'No es tu giro o no pertenece a tu negocio, reconfigura tu perfil de palabras clave <a href=\"https://enlacecanaco.org/app/myaccount/\" target=\"_blank\">aquí</a>', 'Admin y superadmin', 'Tenemos identificados $ sin contestar', 'Mensual\r', NULL, NULL, NULL, 1),
(16, 'Oportunidad de negocio', 'Hay una oportunidad de negocio para tu marca ¡postula hoy mismo!', 'Haz crecer tu negocio, haciendo negocios con empresas queretanas como la tuya, ofrece la mejor calidad, atención y compromiso a nuestra comunidad e incrementa tus credenciales en nuestra plataforma.  \n\nEl requerimiento es:\n%REQ%\n', '¿Ya lograste cerrar una venta, enviar cotización o agendar cita para una presentación? Evalúa al comprador <a href=\"https://enlacecanaco.org/app/mis_oportunidades/misoportunidades/\" target=\"_blank\">aquí</a>', 'No es tu giro o no pertenece a tu negocio, reconfigura tu perfil de palabras clave <a href=\"https://enlacecanaco.org/app/myaccount/\" target=\"_blank\">aquí</a>', 'Superadmin y admin', 'Esta semana se generaron $ oportunidades de negocio (matchs)', 'Semanal\r', NULL, NULL, NULL, 1),
(17, 'Me quiero afiliar', '!Bienvenido/a a la comunidad CANACO!', 'Nos da gusto que desees ser parte activa de nuestro organismo empresarial, nuestro proceso de afiliación es muy sencillo: 1. Elige la membresía que se ajuste más al perfil de tu empresa  2. Realiza la transferencia electrónica del monto respectivo 3. Envíanos el comprobante de pago respectivo por este medio o al número de </a href=\"https://wa.me/524422198567\" target=\"_blank\">whatsapp</a> 4. Espera nuestra confirmación de acreditación de los recursos 5. Recibe tu número de afiliación y registro al SIEM a tu correo electrónico registrado en nuestra plataforma.', 'Si tienes alguna duda sobre los beneficios de cada una de nuestras membresías, agenda una cita con uno de nuestros afiliadores oficiales, manda un whatsapp al </a href=\"https://wa.me/524425375301\" target=\"_blank\">4425375301</a>', 'O si lo prefieres visítanos en: <a href=\"https://www.google.com.mx/maps/place/Canaco/@20.5763899,-100.3841017,17z/data=!4m12!1m6!3m5!1s0x85d344c51461cc3f:0x3a5c3e33a3170734!2sCanaco!8m2!3d20.5763849!4d-100.3819076!3m4!1s0x85d344c51461cc3f:0x3a5c3e33a3170734!8m2!3d20.5763849!4d-100.3819076\" target=\"_blank\">Av. Luis Vega Monrroy 405, Quinta Balaustradas, 76079, Santiago de Querétaro, Qro.</a> y con gusto te atendemos :D', 'Admin y contabilidad', 'Acaban de hacer la solicitud de afiliación automatizada en la plataforma', 'Por evento\r', NULL, NULL, NULL, 1),
(18, 'Refinamiento keywords', 'Nuestra plataforma ha registrado que has recibido más de 3 oportunidades de negocios \"erróneas\", valdría la pena reconfigurar o complementar tu perfil para ser más certeros en las oportunidades de negocio que debemos enviarte.', 'La manera ms efectiva de configurar tu perfil de empresa en nuestra plataforma es decribiendo tus productos, soluciones y servicios de una manera muy similar a como tu mercado objetivo lo busca en Google, afina tu perfil y recibe más oportunidades de negocios con nuestra potente tecnología <a href=\"https://enlacecanaco.org/app/myaccount/\" target=\"_blank\">aqui</a>.', 'Conoce el reporte general de las palabras claves más buscadas, los gremios más solicitados aquí %', 'Desarrolla las competencias de tu equipo de trabajo con el amplio portafolio de cursos de capacitación que impartimos, revisa nuestra calendarización <a href=\"https://www.camaradecomercioqro.mx/por-que-es-importante-afiliarse/\" target=\"_blank\">aquí</a>:', '', '', '', NULL, NULL, NULL, 1),
(19, 'Validación de documentos', '¡Felicidades haz obtenido la insignia profesional %!', 'Hemos revisado los documentos que amablemente nos enviaste a través de la plataforma y a partir de este momento aparecerá activada la insignia profesional. Checa como lucen tus credeciales en nuestra plataforma <a href=\"https://enlacecanaco.org/app/myaccount/awards\" target=\"_blank\">click aqui.</a>', 'Incrementa tus oportunidades de negocio de manera, obteniendo el mayor número de insignias, valoraciones y medallas. Checa el cuadro de honor aquí %', '¿Ya cuentas con tu insignia CANACO PREMIUM? Si aún no la obtienes afilíate hoy mismo e incrementa tus oportunidades de negocio. <a href=\"https://www.canacoqueretaro.org/membresias\" target=\"_blank\">Afiliate aquí</a>.', '', '', '', NULL, NULL, NULL, 1),
(20, 'Hemos recibido tu solicitud UPGRADE', 'Extiende los beneficios CANACO, sube de nivel y crezcamos juntos.', 'Estas son nuestras opciones: <a href=\"https://www.camaradecomercioqro.mx/membresias/\" target=\"_blank\">Conócelas, </a>elige el plan, paga la diferencia aritmética y accede a los nuevos beneficios que la cámara grande del Estado de Querétaro ha desarrollado para ti.', 'Conoce el top ten de negocios con las mejores valoraciones, los gremios más solicitados y el medallero de Diamante aquí %', '¿Conoces a la CONCANACO? <a href=\"https://www.concanaco.com.mx/\" target=\"_blank\">Visita su sitio web</a>', 'Admin y contabilidad', 'El usuario % desea hacer un upgrade de su afiliación automatizada a través de la plataforma', 'Por evento\r', NULL, NULL, NULL, 1),
(21, 'Confirma recepción de cotizaciones', '¡Nuestra comunidad responde!', 'Hay % comercios registrados en nuestra plataforma que están interesados en solventar el requerimiento que publicaste, revisa sus credenciales, trayectoria, medallas e insignias obtenidas <a href=\"https://enlacecanaco.org/app/mis_oportunidades/misoportunidades/\" target=\"_blank\">aquí</a>.', 'Si haz elegido como proveedor alguno de nuestros comercios registrados, haz comunidad y valora su atención, precio y servicio. También ayúdanos confirmando que tu requerimiento ha sido solventado <a href=\"https://enlacecanaco.org/app/requirements/mis_requerimientos\" target=\"_blank\">aquí</a>.', 'Descubre la amplia variedad de beneficios y soluciones que ofrecemos a los comercios en Querétaro. <a href=\"https://www.camaradecomercioqro.mx/\" target=\"_blank\">Visita nuestro sitio web</a>', '', '', '', NULL, NULL, NULL, 1),
(22, 'Sin respuestas', '¡Hola! Hace más de 3 meses que amablemente te registraste en nuestra plataforma y hemos detectado que aún no te hemos enviado oportunidades de negocios y deseamos resolver la situación de manera conjunta.\r\n\r\n¿Ya revisaste las palabras clave de tus productos o servicios?', 'Conoce el reporte general de los gremios más solicitados asá como los productos, servicios y soluciones que más se han solventado a través de nuestra plataforma; también  el top ten de comercios con más cierres realizados aquí.%', 'Revisa la configuración de tu <a href=\"https://enlacecanaco.org/app/myaccount/\" target=\"_blank\">perfil</a>, tus palabras clave de las soluciones, productos y servicios que ofreces e incrementemos las posibilidades de visibilidad de tu empresa y su amplia trayectoria.', 'Afíliate hoy mismo a la cámara y obtén tu insignia de negocio afiliado CANACO con lo cual aparecerás en los primeros lugares de opciones, cuando nuestra plataforma haga mach con tus productos o servicios da <a href=\"https://www.camaradecomercioqro.mx/membresias/\" target=\"_blank\">click aquí</a>', '', '', '', NULL, NULL, NULL, 1),
(23, 'Evalúa a tu proveedor', 'Ayúdanos a mejorar la comunidad CANACO', 'Evalúa la calidad, atención y compromiso de nuestros comercios queretanos con esta encuesta de 1 minuto y contribuye a consolidar un gremio profesional, ético y confiable. %', '¿Ya conoces el total de medallas e insignias que puede obtener? <a href=\"https://enlacecanaco.org/app/myaccount/awards\" target=\"_blank\">Badges</a> Conoce el medallero topten %', 'Contrata uno de nuestros lives y llega a ampliar la audiencia para tu marca o negocio (servicio gratuito para la membresía CONSOLIDADO) <a href=\"https://www.canacoqueretaro.org/membresias\" target=\"_blank\">aquí</a>', '', '', '', NULL, NULL, NULL, 1),
(24, '72 hrs ¿elegiste proveedor?', 'Hemos registrado que aún no eliges proveedor sin embargo contabilizamos % postulantes ¿Ya solventaste tu requerimiento?', 'Da <a href=\"https://enlacecanaco.org/app/mis_oportunidades/misoportunidades/\" target=\"_blank\">click aquí</a> y conoce las credenciales, valoraciones y medallas que los postulantes han logrado en nuestra plataforma, estamos seguros que recibirás la mayor calidad, compromiso y atención con la comunidad ENLACE CANACO.', 'Contesta esta breve encuesta y ayúdanos a mejorar %', 'Antes de formalizar con alguno de los comercios registrados, revisa nuestras <a href=\"https://enlacecanaco.org/\" target=\"_blank\">políticas de uso y privacidad</a>', '', '', '', NULL, NULL, NULL, 1),
(27, 'Diamante', 'Haz alcanzado la máxima condecoración que ofrecemos ¡Muchas felicidades!', 'Esto significa que al menos tienes 5 medallas  de todas las que manejamos y además tienes la insignia dorada. Agradecemos tu entusiasta participación y profesionalismo, en pro del sano comercio queretano. Tus medallas son: %MEDALLAS%', 'Continuen contribuyendo en nuestra comunidad, ayúdandonos a valorar a todas las transacciones comerciales realizadas así como publicando todos los requerimientos y órdenes de compra de tu organización y con ello darle todo el dinamismo posible al comercio organizado en nuestra entidad <a href=\"https://enlacecanaco.org/app/mis_oportunidades/misoportunidades/\" target=\"_blank\"aqui</a>.', 'Próximamente tendremos la versión 2.0 de esta plataforma, con mayor información de valor, más simplificación en los servicios que como cámara ofrecemos, mayor representatividad ante instancias gubernamentales, más retos a cumplir y alcanzar. Gracias por ser parte de la familia CANACO.', 'Admin y superadmin', 'Las medallas alcanzadas este mes son: % <a href=\"https://enlacecanaco.org/\" target=\"_blank\">Revisa reporte</a>', 'Mensual\r', NULL, NULL, NULL, 2),
(28, 'Comunidad', 'El tiempo que nos regalas para retroalimentar a nuestra comunidad, nos hace mejores y mis profesionales a todos. A partir de hoy se publicará la medalla Comunidad en tu perfil ante posibles clientes. Sigue haciendo comunidad y está medalla te dará mejores oportunidades de negocio.', '¿Cómo obtuviste la medalla Comunidad? Esta medalla se obtiene cuando brindas retroalimentación total de al menos el 50% de tus transacciones confirmadas como realizadas.', 'Es importante calificar el mayor número de transacciones que confirmas como realizadas para evitar que esta medalla deje de publicarse en tu perfil empresarial, ya que a mayor número de transacciones comerciales realizadas, gracias a nuestra palataforma, necesitaremos más de tu valiosa aportación y valoración.', 'Si tienes alguna sugerencia de como mejorar o simplificar nuestras valoraciones, puedes contactarnos a andy@impactosdigitales.com ', '', '', '', NULL, NULL, NULL, 2),
(29, 'Elite', '!Ya eres Elite para nuestra plataforma!', 'Esto significa que estas en el topten de empresas que más requerimientos solventa. Esta es una medalla dinámica que constantemente está rotando en nuestra plataforma, mantente al pendiente de todas la oportunidades de negocio que se presenten para tu empresa y consérvala vigente.', 'La medallas que actualmente aparecen en tu perfil son: <a href=\"https://enlacecanaco.org/app/myaccount/awards\" target=\"_blank\">Consultar aqui</a>.', '¿Qué consideras que debe mejorar nuestra plataforma? Escríbenos a: andy@impactosdigitales.com ', '', '', '', NULL, NULL, NULL, 2),
(30, 'Tractora', '!La tracción de tu empresa nos hace más fuertes!', 'Hoy has obtenido la medalla TRACTORA que significa que estás en el top ten de empresas que más requerimientos publica. Como organismo empresarial agradecemos tu compromiso con el comercio queretano y te invitamos a conocer nuestros planes de patrocinio que manejamos con empresas tan comprometidas la de uds. Escríbenos a presidencia@canacoqro.com', '¿Sabías que contamos con % empresas registradas en nuestra plataforma? Diariamente publicamos % oportunidades de negocio y tu empresa contribuye sustancialmente a la consistente recuperación económica en nuestro Estado.', 'Estate pendiente de todas las actividades que como organismo empresarial tenemos semana a semana y continuemos fortaleciendo el comercio formal en Queretaro.', '', '', '', NULL, NULL, NULL, 2),
(31, 'Calificadora', '!Haz obtenido la medalla CALIFICADORA!', 'Esta medalla se obtiene por que nos has apoyado a calificar más del 80% de las oportunidades de negocio que te hemos enviado, lo cual nos ayuda a consolidar la gran comunidad CANACO que estamos construyendo.', 'Conoce el top ten de gremios así como la categoría ELITE (el topten de empresas  que mas requerimientos solventa) aquí %', 'Revisa las credenciales de tu perfil de empresa y continuemos consolidando la gran comunidad CANACO <a href=\"https://enlacecanaco.org/app/myaccount/awards\" target=\"_blank\">aquí</a>.', '', '', '', NULL, NULL, NULL, 2),
(32, 'Total', 'Bienvenidos a la parte de VIE (Very Important Enterprises) de nuestra plataforma, a partir de este momento aparecerá en tu perfil la medalla TOTAL', 'En nuestra plataforma, a partir de este día, cada que haya un match entre requerimiento publicado y las soluciones, servicios y productos que ofreces, tendrás preferencia en el enlistado y publicación de los datos de contacto del perfil de tu empresa y en ocasiones tendrás exclusividad en oportunidades de negocio si la empresa que publica así lo decide. Todo lo anterior por tener tu perfil completado en nuestra plataforma.', 'Nuestros afiliados a la cámara de comercio tienen beneficios exclusivos, servicios únicos y representatividad ante un amplio numero de dependencias municipales, estatales o federales, revisa todas las categorías de membresías que manejamos y aprovecha todo el impulso que nuestro organismo empresarial ha diseñado para ti.', '¿Conoces a la CONCANACO? <a href=\"https://www.camaradecomercioqro.mx/\" target=\"_blank\">Visita su sitio web</a>.', '', '', '', NULL, NULL, NULL, 2),
(33, 'Flash', 'El profesionalismo e infraestructura de tu empresa es un gran diferenciador en el mercado y a partir de hoy será resaltado con la Medalla FLASH', 'Esta medalla la obtienen las empresas que en nuestra plataforma el 40% de los requerimientos -que se confirmaron como solventados- eran urgentes para los clientes.', 'Desarrolla las competencias de tu equipo de trabajo con nuestro amplio portafolio de cursos de capacitación que impartimos, revisa nuestra calendarización <a href=\"https://www.camaradecomercioqro.mx/por-que-es-importante-afiliarse/\" target=\"_blank\"aqui</a>', 'Conoce el top ten de gremios más solicitados así como la categoría ELITE (el top ten de empresas que mas requerimientos solventa) <a href=\"https://enlacecanaco.org/\" target=\"_blank\">aquí</a>', '', '', '', NULL, NULL, NULL, 2),
(34, 'Podium', 'Eres de los 10 con mejor desempeño en nuestra plataforma ¿Ya viste como luce la medalla PODIUM en el perfil de tu empresa?', 'Esta medalla la has obtenido por que eres uno de los 10 comercios con mayores transacciones comerciales confirmadas -por parte de nuestros usuarios- que has solventado. Da seguimiento a las oportunidades de negocio que nuestra plataforma te envía y mantente en este selecto topten de ENLACE CANACO.', '¿Ya obtuviste tu insignia dorada? Si es así, solo te faltan %medals% medallas para alcanzar la medalla DIAMANTE, revisa los requisitos <a href=\"https://enlacecanaco.org/app/myaccount/awards\" target=\"_blank\">aquí,</a> para lograr nuestra máxima condecoración, por ser una empresa profesional, comprometida y referente de nuestra comunidad CANACO.', '¿Sabías que el día de ayer, se publicaron %publicados% requerimientos y se solventó el %porcentaje%? Cada que necesites un proveedor confiable, publica tu requerimiento y recibe en tiempo real y de manera gratuita propuestas, servicios y productos de la comunidad CANACO.', '', '', '', NULL, NULL, NULL, 2),
(37, 'Dorada', 'El compromiso y profesionalismo, serán grandes aliados de tu crecimiento como empresa y queremos reconocercelos, en este instante, con la insignia DORADA.', 'A partir de este momento la confianza en tu marca incrementará ya que cuentas con al menos 5 insignias + esta nueva insignia que es muestra de la seriedad con la que tu marca hace negocios con sus clientes y grupos de interés.', 'Actualmente tienes %TOTAL% medallas ¿Sabías que solo te hacen falta %FALTA% medallas para obtener la medalla DIAMANTE? Publica requerimientos, postula a las oportunidades de negocio que te enviamos a tu bandeja de entrada, evalúa, participa y crece con ENLACE CANACO.', 'Tienes %TRANSACCIONES% transacciones sin evaluar, ayúdanos a construir una comunidad más comprometida y evalúa a tus proveedores, compradores y oportunidades de negocio que te hemos enviado <a href=\"https://enlacecanaco.org/app/mis_oportunidades/misoportunidades/\" target=\"_blank\">aquí</a>. Te llevará menos de 3 minutos evaluar cada transacción pendiente y obtén o mantén vigente tu medalla CALIFICADORA.', 'Admin y superadmin', 'El número total de insignias asignadas este mes son: % <a href=\"https://enlacecanaco.org/\" target=\"_blank\">Revisa reporte</a>', 'Mensual\r', NULL, NULL, NULL, 3),
(38, 'CANACO elite', '', 'Es proveedor Calidad CANACO', '', '', '', '', '', NULL, NULL, NULL, 3),
(39, 'Queretaro', '!Felicidades! Hemos validado tus contratos con gobierno, por lo que a partir de este momento, en tu perfil aparecerá la insignia QUERÉTARO.', 'Por ser proveedor vigente de gobierno del Estado o municipio de Querétaro, reconocemos tu experiencia, compromiso con nuestra entidad e infraestructura con esta insignia.', '¿Cómo podemos mejorar nuestra plataforma?  Nos interesa tu amplia experiencia y trayectoria, escríbenos a: andy@impactosdigitales.com', 'Tienes % transacciones sin evaluar, ayúdanos a construir una comunidad más comprometida y evalúa a tus proveedores, compradores y oportunidades de negocio que te hemos enviado <a href=\"https://enlacecanaco.org/app/mis_oportunidades/misoportunidades/\" target=\"_blank\">aquí</a>. Te llevará menos de 3 minutos evaluar cada transacción pendiente y obtén o mantén vigente tu medalla CALIFICADORA.', '', '', '', NULL, NULL, NULL, 3),
(40, 'Industrial', '!Felicidades! Hemos validado tus contratos con la industria en nuestra entidad, por lo que a partir de este momento, en tu perfil aparecerá la insignia INDUSTRIAL.', 'Reconocemos tu alto desempeño como empresa por lo que toda nuestra comunidad, verá la insignia INDUSTRIAL en tu perfil, como una muestra de tu capacidad de respuesta y atención.', 'Agradecemos tanto tus publicaciones de requerimientos como tus valoraciones, por que con ello contribuyes a hacer más fuerte a la comunidad CANACO. Si tienes algún tip para mejorar como comunidad, escríbenos a: andy@impactosdigitales.com y con gusto escucharemos tus propuestas.', 'Tienes % transacciones sin evaluar, ayúdanos a construir una comunidad más comprometida y evalúa a tus proveedores, compradores y oportunidades de negocio que te hemos enviado <a href=\"https://enlacecanaco.org/app/mis_oportunidades/misoportunidades/\" target=\"_blank\">aquí</a>. Te llevará menos de 3 minutos evaluar cada transacción pendiente y obtén o mantén vigente tu medalla CALIFICADORA.', '', '', '', NULL, NULL, NULL, 3),
(41, 'CANACO premium', 'Valoramos tu compromiso con nuestra comunidad, dándote una afectuosa bievenida a CANACO, la cámara grande. ', 'A partir de este momento, como afiliado CANACO, tendrás preferencia de las oportunidades comerciales que nuestra plataforma identifique que hagan match con los productos y servicios que tu marca ofrece.', 'Te invitamos a revisar o actualizar la descripción de tus palabras clave, categorías y gremios que tienes dados de alta en tu perfil de empresa con lo que nuestra plataforma sea más asertiva en la identificación oportunidades de negocio para tu empresa <a href=\"https://enlacecanaco.org/app/myaccount/\" target=\"_blank\">aquí</a>.', '¿Sabías que el día de ayer, se publicaron %publicados% requerimientos y se solventó el %porcentaje%%? Cada que necesites un proveedor confiable, publica tu requerimiento y recibe en tiempo real y de manera gratuita propuestas, servicios y productos de la comunidad CANACO <a href=\"https://enlacecanaco.org/app/home\" target=\"_blank\">aquí</a>.', 'Contabilidad ', 'El usuario % ha enviado su comprobante de pago, revisa por favor la acreditación de recursos y confirma la obtención de su INSIGNIA CANACO PREMIUM <a href=\"https://enlacecanaco.org/app/contaduria/validarafil\">aquí</a>', 'Por evento\r', NULL, NULL, NULL, 3),
(42, 'Profesional', 'Envío todos sus documentos y fueron validados.', 'Envío todos sus documentos y fueron validados.', '', '', '', '', '', NULL, NULL, NULL, 3),
(43, 'Queretana', '¡Felicidades, se ha activado la insignia Queretana!', 'A partir de este momento, en tu perfil aparecerá tu dirección de atención a clientes o de tus oficinas, la insignia de empresa verificada (con su razón social en activo así como licencia de funcionamiento) y el número de afiliación a nuestro organismo (en su caso).', '¿Cómo podemos mejorar nuestra plataforma?  Nos interesa tu amplia experiencia y trayectoria, escríbenos a: andy@impactosdigitales.com', 'Tienes % transacciones sin evaluar, ayúdanos a construir una comunidad más comprometida y evalúa a tus proveedores, compradores y oportunidades de negocio que te hemos enviado <a href=\"https://enlacecanaco.org/app/mis_oportunidades/misoportunidades/\" target=\"_blank\">aquí</a>. Te llevará menos de 3 minutos evaluar cada transacción pendiente y obtén o mantén vigente tu medalla CALIFICADORA.', '', '', '', NULL, NULL, NULL, 3),
(44, 'Geolocalización', 'Se ha publicado tu geolocalización en Gmaps, ahora tus clientes podrán encontrarte de una manera más rápida y confiable.', 'A partir de este momento se mostrará él link de gmaps ha tus oficinas de atención a clientes, esta insignia brinda seguridad y confianza a la comunidad emprendedora del estado por la transparencia de tus datos de localización y atención.', '¿Ya cuentas con el VoBo. de protección civil del Estado?, con tu afiliación CANACO, recuerda que tienes de manera gratuita la gestoría del trámite de tu licencia municipal, Vo. Bo. de protección civil, factibilidad de giro. <a href=\"https://www.camaradecomercioqro.mx/membresias/\" target=\"_blank\">Afíliate hoy mismo </a>y pon en regla los permisos municipales y estatales necesarios para el óptimo funcionamiento de tu negocio.\n', 'En tu empresa ¿Ya está implementada y adoptada la NOM-035? Esta norma es muy importante para tu empresa, si requieres asesoría, contáctanos, te ayudamos a implementarla.', '', '', '', NULL, NULL, NULL, 3),
(45, 'Sucursales', 'Hemos registrado tus sucursales y en perfil se informará a nuestra comunidad la dirección de cada una de estas.', 'Esta insignia, permitirá que la comunidad CANACO que decida contratar tus servicios elija la sucursal más cercana a su ubicación', '¿Sabías que contamos con %EMPRESAS% empresas registradas en nuestra plataforma? Diariamente publicamos %PUBLICACIONES% oportunidades de negocio y tu empresa contribuye sustancialmente a la consistente recuperación económica en nuestro Estado.', 'Desarrolla las competencias de tu equipo de trabajo con nuestro amplio portafolio de cursos de capacitación que impartimos, revisa nuestra calendarización <a href=\"https://www.camaradecomercioqro.mx/por-que-es-importante-afiliarse/\" target=\"_blank\">aquí.</a>', '', '', '', NULL, NULL, NULL, 3),
(46, 'ecommerce', 'El comercio electrónico es una de las tendencias más consolidadas del año 2020 a la fecha y a partir de este momento la dirección electrónica de tu tienda en línea está siendo publicado.', '¡La insignia de tienda en línea, incrementará el número de visitantes a tu ecommerce!', '¿Cómo podemos mejorar nuestra plataforma?  Nos interesa tu amplia experiencia y trayectoria, escríbenos a: andy@impactosdigitales.com', 'Conoce el top ten de gremios más solicitados así como la categoría ELITE (el topten de empresas que más requerimientos solventa) <a href=\"https://enlacecanaco.org/\" target=\"_blank\">aqu?</a>', '', '', '', NULL, NULL, NULL, 3),
(47, 'ecommerce total', 'Hemos validado tu punto de atención físico así como tu ecommerce por lo que a partir de la recepción de  este email, se activará la INSIGNIA ECOMMERCE TOTAL', 'El link de gmaps de tu tienda con punto de atención que tenemos registrado es: % y el dominio de tu tienda en línea es: Da <a href=\"https://enlacecanaco.org/app/myaccount/\" target=\"_blank\">click aquí</a> si deseas editar la información.', 'Ayúdanos a fortalecer la comunidad ENLACE CANACO y publica tus órdenes de compra en nuestra plataforma y encuentra los proveedores más confiables de nuestra entidad. <a href=\"https://enlacecanaco.org/app/home\" target=\"_blank\">Da click aquí</a>', 'En tu empresa ¿Ya está implementada y adoptada la NOM-035? Esta norma es muy importante para tu empresa, si requieres asesoría, contáctanos, te ayudamos a implementarla', '', '', '', NULL, NULL, NULL, 3),
(48, 'Corporativa', 'Hemos validado las oficinas corporativas de tu empresa, por lo que se ha agregado la INSIGNIA CORPORATIVA  a tu perfil de empresa en nuestra plataforma.', '¿Sabías que contamos con más de % gremios registrados en nuestra plataforma? Publiquen sus órdenes de compra locales o nacionales y reciban en tiempo real, propuestas en firme para solventar sus requerimientos de compra.', 'Te invitamos a conocer los beneficios exclusivos para empresas patrocinadoras de nuestro organismos empresarial. Escríbannos a comercializacion@canacoqro.com.mx', 'Desarrolla las competencias de tu equipo de trabajo con nuestro amplio portafolio de capacitadores certificados así como los cursos de capacitación que impartimos, revisa nuestra calendarización <a href=\"https://enlacecanaco.org/app/myaccount/awards target=\"_blank\">aqu?</a>', '', '', '', NULL, NULL, NULL, 3),
(49, 'Tradición', 'Como tienes más de 3 años afiliado a nuestro organismo empresarial, haz obtenido la insignia TRADICIÓN ¡Felicidades!', 'Para nosotros es un orgullo que su empresa este afiliada desde % por lo que en tu perfil empresarial, en nuestra plataforma, aparecerá esta insignia, siempre y cuando tu afiliación está vigente. Gracias por ser parte de la familia CANACO.', '¿Cómo podemos mejorar nuestra plataforma?  Nos interesa tu amplia experiencia y trayectoria, escríbenos a: andy@impactosdigitales.com', 'En tu empresa ¿Ya está implementada y adoptada la NOM-035? Esta norma es muy importante para tu empresa, si requieres asesoría, contáctanos, te ayudamos a implementarla', '', '', '', NULL, NULL, NULL, 3),
(52, 'Principal', 'Haz recibido una valoración por parte de una empresa registrada en nuestra plataforma. Revisa aquí sus comentarios.', 'El promedio de calificaciones de tus productos, servicios o soluciones es: %', '¿Deseas mejorar tu valoración? Contacta al usuario que la ha emitido a través de nuestra plataforma y mejora el promedio de las valoraciones de tus transacciones comerciales confirmadas.', '¿Sabías que el día de ayer, se publicaron & requerimientos y se solventó el %%? Cada que necesites un proveedor confiable, publica tu requerimiento y recibe en tiempo real y de manera gratuita propuestas, servicios y productos de la comunidad CANACO.', 'Admin y superadmin', 'El reporte total de valoraciones en la plataforma es: % <a href=\"https://enlacecanaco.org/\" target=\"_blank\">Revísalo aquí</a>', 'Mensual\r', NULL, NULL, NULL, 4),
(53, 'Vigente', 'Hace más de 60 días que no haz publicado o recibido alguna oportunidad de negocio ?Deseas revisar la configuración de tus palabras clave o encontrar un proveedor confiable en la comunidad ENLACE CANACO?', 'Tu última publicación realizada en nuestra plataforma fue: %', 'Revisa la configuración de tus palabras clave <a href=\"https://enlacecanaco.org/app/myaccount/\" target=\"_blank\">aquí</a>. Nos interesa tu amplia experiencia y punto de vista escríbenos a: andy@impactosdigitales.com', '¿Sabías que el día de ayer, se publicaron % requerimientos y se solventó el % %? Cada que necesites un proveedor confiable, publica tu requerimiento y recibe en tiempo real y de manera gratuita propuestas, servicios y productos de la comunidad CANACO.', '', '', '', NULL, NULL, NULL, 4),
(54, 'Compradora', 'Hoy se ha publicado tu requerimiento número % Gracias por hacer de esta plataforma tecnológica la de mayor ENLACES entre el comercio Queretano', 'Número de requerimientos publicados aparecerán en tu perfil de empresa verificado.', 'En breve recibirás contactos de empresas interesadas en solventar tu requerimiento. Si deseas editar las generales de tu publicación, da <a href=\"https://enlacecanaco.org/app/requirements/mis_requerimientos\" target=\"_blank\">click aquí</a>. Si tu requerimiento es solventado por nuestra comunidad, recuerda inhabilitar tu publicación y cuando la transacción comercial este solventada en su totalidad, ayúdanos a generar información confiable, valorando al proveedor que hayas elegido.', 'Antes de formalizar una transacción comercial con alguno de los comercios registrados, revisa nuestras <a href=\"https://enlacecanaco.org/\" target=\"_blank\">políticas de uso y privacidad</a>', '', '', '', NULL, NULL, NULL, 4),
(55, 'Solucionadora', 'Se ha enviado tu postulación con los datos de contacto de tu empresa.', 'En tu perfil de empresa registrada aparecerán el número de requerimientos postulados. Mucha suerte.', '¿Sabías que contamos con % empresas registradas en nuestra plataforma? Diariamente publicamos % oportunidades de negocio y tu empresa contribuye sustancialmente a la consistente recuperación económica en nuestro Estado.', 'Conoce el top ten de gremios más solicitados así como la categoría ELITE (el topten de empresas  que mas requerimientos solventa) <a href=\"https://enlacecanaco.org/\" target=\"_blank\">aquí</a>', '', '', '', NULL, NULL, NULL, 4),
(56, 'Cerradora', '¡Felicidades! La empresa % ha confirmado que fuiste la empresa elegida para solventar su requerimiento publicado el pasado % el cual buscaba %', 'El número total de requerimientos solventados que llevas a través de nuestra plataforma es: %, dicha métrica será pública con la finalidad de incrementar tus oportunidades de cierre en matchs generados en nuestra plataforma.', '¿Cómo podemos mejorar nuestra plataforma?  Nos interesa tu amplia experiencia y trayectoria, escríbenos a: andy@impactosdigitales.com', '¿Ya obtuviste tu insignia dorada? Si es así, solo te faltan % medallas para alcanzar la medalla DIAMANTE, revisa los requisitos para lograr nuestra máxima condecoración, por ser una empresa profesional, comprometida y referente de nuestra comunidad CANACO <a href=\"https://enlacecanaco.org/app/myaccount/awards\" target=\"_blank\">aquí</a>.', '', '', '', NULL, NULL, NULL, 4),
(57, 'Participadora', 'Gracias una vez más por tu compromiso y dedicación, la valoración que haz realizado ha quedado registrada en nuestra plataforma.', 'El número de valoraciones realizadas que haz realizado en nuestra plataforma es: %. En tu perfil aparecerá la VALORACIÓN PARTICIPADORA, lo que comunicará con nuestra comunidad que eres una empresa comprometida con la reactivación económica en nuestro Estado.', 'Agradecemos tanto tus publicaciones de requerimientos como tus valoraciones, por que con ello contribuyes a hacer más fuerte a la comunidad CANACO. Si tienes algún tip para mejorar como comunidad, escríbenos a: andy@impactosdigitales.com y con gusto escucharemos tus propuestas.', 'Descubre la amplia variedad de beneficios y soluciones que ofrecemos a los comercios en Querétaro. Visita nuestro <a href=\"https://enlacecanaco.org/app/home\" target=\"_blank\">sitio web</a>', '', '', NULL, NULL, NULL, NULL, 4),
(58, 'Te buscaron y no estas afiliado', '¡Te están buscando!', 'Un comercio realizó una búsqueda que coincide con alguna tus Keywords ¡Afíliate para recibir nuevas oportunidades de negocio <a href=\"https://www.camaradecomercioqro.mx/membresias/\" target=\"_blank\">aquí</a>! ', 'Tu afiliación cuenta con múltiples beneficios sin costo como el trámite de tu licencia municipal o gestión de VoBo de protección civil, contáctanos para mayor información o llámanos, con gusto te atenderemos.', 'Descubre la amplia variedad de beneficios y soluciones que ofrecemos a los comercios en Querétaro. Visita nuestro <a href=\"https://www.camaradecomercioqro.mx/por-que-es-importante-afiliarse/\" target=\"_blank\">sitio web</a>', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(59, 'Envio de factura xml y pdf', 'Te enviamos la factura de tu proceso de afiliación', 'A partir de este momento la confianza en tu marca incrementará ya que cuentas con al menos 5 insignias + esta nueva insignia que es muestra de la seriedad con la que tu marca hace negocios con sus clientes y grupos de interés.', 'Tu afiliación cuenta con múltiples beneficios sin costo como el trámite de tu licencia municipal o gestión de VoBo de protección civil, contáctanos para mayor información o llámanos, con gusto te atenderemos.', '¿Qué consideras que debe mejorar nuestra plataforma? Escríbenos a: andy@impactosdigitales.com ', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(60, 'Nuevo no macht', 'Hola en este momento la empresa %NAME_EMPRESA% que ofrece  %ARRAY_KEY% está buscando %NO_MACHT%', 'La fecha y hora exacta del no macht fue: %DATE%', 'El no match ya aparece en la cintilla de la plataforma sin embargo es importante publicar el no macht en las redes sociales de la cámara así como al equipo de afiliación para poder solventar el requerimiento a la brevedad y poder aprovechar esta oportunidad de negocio.', 'Actualmente en la plataforma tenemos %OPORTUNIDADES% oportunidades de negocio vigentes y %CIERRES% cierres de ventas confirmados.', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
