(2, 'Servicio-001', '2024-01-24 19:48:15', 'Informe de Reunión\n\nFecha: [Fecha de la Reunión]\n\nAsistentes:\n\n[Nombre 1]\n[Nombre 2]\n[Nombre 3]\nTemas Discutidos:\n\nResumen de Avances:\n\nSe revisaron los avances del proyecto [nombre del proyecto].\n[Nombre 1] presentó los resultados del análisis de mercado.\nPróximos Pasos:\n\nSe acordó asignar tareas específicas para la próxima semana.\n[Nombre 2] se encargará de coordinar la reunión con el equipo de desarrollo.\nProblemas Identificados:\n\nSe discutió el problema [descripción del problema] y se propusieron posibles soluciones.\nAnuncios:\n\n[Nombre 3] anunció la próxima capacitación programada para [fecha].\nAcciones a Seguir:\n\n[Nombre 1] enviará el informe detallado de los avances por correo electrónico antes del [fecha].\nSe programará una reunión de seguimiento el [próxima fecha de reunión].\nPróxima Reunión:\n[Fecha y hora de la próxima reunión]\n\n', '1', 0, ''),
